window.bookSummaryJSON = "<p><b>Seven names. Seven families of royal vampires on Night Hill. </b></p> <p><b>One stands above all.</b></p> <p><b>After centuries of freedom, no one is happy to kneel to a new Eirikrson. </b></p> <p>Diana intended to stop by Oldcrest for a pit stop. Catch up with her brother, meet his mate, maybe convince them to name their firstborn after her. </p> <p>She’ll soon learn, as a Helsing, she must pick a side. Before one is picked for her. </p> <p>Mikar has spent centuries following Levi to thank him for saving his life, but when all hell breaks loose, he has to decide whether to get the freedom he’s earned or die with the rest of his friends. </p> <p>Was there even a choice?</p>"; 
